import React, { Component } from "react";
import "./MenShoesHeader.scss";

class MenShoesHeader extends Component {
  render() {
    return (
      <div className="MenShoesHeader">
        <div className="titleSection">
          <div className="subTitle">Men</div>
          <div className="mainTitle">Men's 신발</div>
          <div className="spaceTitle"></div>
        </div>
        <div className="sortingSection">
          <div className="sortingIcons">
            <div className="sortingFilter">Filter</div>
            <div className="sortingInOrder">신상품순</div>
            <i class="fas fa-angle-down"></i>
          </div>
        </div>
      </div>
    );
  }
}

export default MenShoesHeader;
